// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import LoginForm from './components/LoginForm';

const App = () => {
  return (
    <div>
      <LoginForm />
    </div>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
